import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app_wrapper">
      <header className = 'header'>
        <img src='https://ru.msi.com/images/MSI_logo_for_share2.png' />
      </header>

      <nav>
        <div>Profile</div>
        <div>Messages</div>
        <div>News</div>
        <div>Music</div>
      </nav>

      <div>

      </div>
    </div>
  );
}

export default App;
